INSERT INTO "product" (product_name,product_type,price,image_url,description,created_at) VALUES ('ブラジル','PURE_COFFEE',568,'ERD.PNG','ブルーマウンテン（ジャマイカ） 卓越した香気を持ち、調和の取れた味わい、軽い口当りと滑らかな咽越しが特徴。最高級の品質と呼ばれる。ジャマイカで生産されるコーヒーのうちごく一部の産地のものがブルーマウンテンとブランド付けられる。その中でもさらにランク付けがなされる[14]。 ','2018-09-13'),('アイリッシュ・コーヒー','FROM_COFFEE',499,'ERD.PNG','サルバドル（エルサルバドル） 強く主張する味は無く、全体に甘く上品で柔らかな印象の味わい。 ','2018-01-23'),('グアテマラ','FROM_COFFEE',323,'ERD.PNG','リベリカ種 高温多湿の気候に適応するが病害に弱く、品質もアラビカ種に及ばない。 ','2017-12-20'),('アイリッシュ・コーヒー','FROM_COFFEE',544,'ERD.PNG','モカ（イエメン、エチオピア） 香気に優れ独特の酸味を持ち、甘みとコクが加わる。もっとも古い「ブランド」である。コーヒー原産地であり、イタリアなどではコーヒーのことをモカと呼ぶ。イエメン産の「マタリ」[15]、エチオピア産の「ハラー」、「シダモ」等が有名[16]。 ','2018-04-02'),('ブルーマウンテン（ジャマイカ）','FROM_COFFEE',564,'ERD.PNG','トラジャ（インドネシア） スラウェシ島産。苦みが中心の味で、非常に濃厚なコクを持つ。酸味は無い。カロシ・トラジャもしくは単にカロシという名称が使われることもある。 ','2018-12-10'),('トラジャ（インドネシア）','FROM_COFFEE',420,'ERD.PNG','コスタリカ どちらかというと酸味系で苦味控えめの味わい、軽めでクリアな飲み口。 ','2018-03-14'),('モカ（イエメン、エチオピア）','NON_COFFEE',348,'ERD.PNG','サルバドル（エルサルバドル） 強く主張する味は無く、全体に甘く上品で柔らかな印象の味わい。 ','2018-12-27'),('コナ（ハワイ島）','FROM_COFFEE',418,'ERD.PNG','インド インドのコーヒー栽培は400年以上の歴史があり、世界中のコーヒー産地の中でも有数の歴史と伝統を誇る。森の生態系を活かしながら有機的な農法で育てられ、5 - 6月に吹くモンスーンを利用した、約7週間を経てできる独特の香味は、欧米の多数の国で愛飲されている最高級品である。 ','2017-09-27'),('トラジャ（インドネシア）','FROM_COFFEE',375,'ERD.PNG','リベリカ種 高温多湿の気候に適応するが病害に弱く、品質もアラビカ種に及ばない。 ','2019-08-08'),('ブルーマウンテン（ジャマイカ）','FROM_COFFEE',541,'ERD.PNG','ケニア フルーツのような爽やかな風味が特徴。全体的に強い風味でバランスが良い。ドイツなどヨーロッパではタンザニア産とともに一般的な銘柄。深めの焙煎が多い。 ','2018-10-07');
INSERT INTO "product" (product_name,product_type,price,image_url,description,created_at) VALUES ('カフェ・ロワイヤル','FROM_COFFEE',467,'ERD.PNG','グアテマラ 酸味とコクに優れ、香気も良好で全体的に華やかさとキレのいい後味が特徴。 ','2017-12-13'),('トラジャ（インドネシア）','FROM_COFFEE',264,'ERD.PNG','パプアニューギニア 浅い焙煎では軽くてクセの少ない風味、深い焙煎ではキレの良い強い苦味とコクのある風味。良質な香気も特徴。最高級品質と言われるブルーマウンテンの苗木をそのまま移植して栽培した品種である。 ','2019-04-07'),('フラッペ','NON_COFFEE',379,'ERD.PNG','ロブスタ種 アラビカ種に比べて耐病性が高く、少雨、高温多湿の土地でも栽培できる。また安定収穫できる様になるまでにかかる期間が3年と短い。栽培が容易なので収量も多く、生産量2位のベトナムで主力となっている[8]。 抽出しやすく水出しも容易だが、カフェイン成分が多く苦みやクセ（ロブスタ臭）が強く、単独での風味はアラビカ種に及ばないとされる。インスタント用原料や、安いレギュラーコーヒーの増量用が主体となっている他、いわゆるベトナムコーヒーに用いられる。 ','2019-01-12'),('ベトナム','FROM_COFFEE',354,'ERD.PNG','サルバドル（エルサルバドル） 強く主張する味は無く、全体に甘く上品で柔らかな印象の味わい。 ','2019-07-04'),('カフェ・オ・レ','FROM_COFFEE',224,'ERD.PNG','コナ（ハワイ島） 非常に強い酸味とコク・風味を持つ。ブレンドに用いると良質な酸味が与えられるといわれる。ブルーマウンテンに次ぐブランドで高価である。 ','2017-11-03'),('カフェ・ラッテ','NON_COFFEE',475,'ERD.PNG','サルバドル（エルサルバドル） 強く主張する味は無く、全体に甘く上品で柔らかな印象の味わい。 ','2018-12-12'),('コスタリカ','PURE_COFFEE',447,'ERD.PNG','ブルーマウンテン（ジャマイカ） 卓越した香気を持ち、調和の取れた味わい、軽い口当りと滑らかな咽越しが特徴。最高級の品質と呼ばれる。ジャマイカで生産されるコーヒーのうちごく一部の産地のものがブルーマウンテンとブランド付けられる。その中でもさらにランク付けがなされる[14]。 ','2018-09-07'),('コスタリカ','FROM_COFFEE',494,'ERD.PNG','ブラジル 香りの甘さが軽快で酸味・コク、苦みともに軽くバランスが良い。安価でありブレンドのベースとして多く使われる。 ','2019-01-17'),('コナ（ハワイ島）','NON_COFFEE',487,'ERD.PNG','サルバドル（エルサルバドル） 強く主張する味は無く、全体に甘く上品で柔らかな印象の味わい。 ','2018-09-20'),('インディアンコーヒー','FROM_COFFEE',315,'ERD.PNG','ロブスタ種 アラビカ種に比べて耐病性が高く、少雨、高温多湿の土地でも栽培できる。また安定収穫できる様になるまでにかかる期間が3年と短い。栽培が容易なので収量も多く、生産量2位のベトナムで主力となっている[8]。 抽出しやすく水出しも容易だが、カフェイン成分が多く苦みやクセ（ロブスタ臭）が強く、単独での風味はアラビカ種に及ばないとされる。インスタント用原料や、安いレギュラーコーヒーの増量用が主体となっている他、いわゆるベトナムコーヒーに用いられる。 ','2019-01-30');
