INSERT INTO "product" (product_name,product_type,price,image_url,description,created_at) VALUES ('グリーン・コーヒー','NON_COFFEE',458,'ERD.PNG','アラビカ種 病害虫や霜、少雨等に弱く栽培が困難だが、風味とコクに優れ、レギュラーコーヒー用を主体とし多様な品種がある。総生産量の約70%を占める[8]。 従来は、ブラジルのブルボンとコロンビアのティピカが、アラビカ種の2大品種と呼ばれ主力品種だった。その後、収量や耐病虫性に優れた品種への置換が進み、最近[いつ?]ではブラジルのカトゥーラ、カトゥアイとムンド・ノーボ、コロンビアのカトゥーラとバリエダ・コロンビアが、それぞれ主力品種となっている。 このほか、スマトラ、モカ（銘柄とは別）、ブルー・マウンテン（ブランドとは別）、コナ、マラゴジッペ、アマレロ、ゲイシャなどがある。 ','2018-06-23'),('コロンビア','NON_COFFEE',377,'ERD.PNG','パプアニューギニア 浅い焙煎では軽くてクセの少ない風味、深い焙煎ではキレの良い強い苦味とコクのある風味。良質な香気も特徴。最高級品質と言われるブルーマウンテンの苗木をそのまま移植して栽培した品種である。 ','2018-06-14'),('アメリカン・コーヒー','FROM_COFFEE',546,'ERD.PNG','グアテマラ 酸味とコクに優れ、香気も良好で全体的に華やかさとキレのいい後味が特徴。 ','2019-04-07'),('コロンビア式コーヒー','PURE_COFFEE',374,'ERD.PNG','キューバ ブルーマウンテンに似た軽くてバランスの良い風味と上品な香気が特徴。ドミニカ共和国やハイチなどカリブ海地域の島国産のコーヒーは総じて似た傾向の風味を有する。 ','2019-07-10'),('アラビア・コーヒー','FROM_COFFEE',451,'ERD.PNG','ベトナムなどアジア地域 ベトナムやネパール、中国など近年になって輸出向けにアラビカ種を導入した地域では、人気のある中南米地域の品種の苗木を導入しているが気候や土壌、生産技術の違いからか同じ品種でも独特の風味を持っている、総じてやや導入もとの中南米地域産に比べて重めの風味になり、酸味は控えめで香気もやや弱くなる傾向がある。','2019-08-02'),('サルタナコーヒー','NON_COFFEE',522,'ERD.PNG','ブラジル 香りの甘さが軽快で酸味・コク、苦みともに軽くバランスが良い。安価でありブレンドのベースとして多く使われる。 ','2018-06-02'),('コーヒーのバリエーション','FROM_COFFEE',473,'ERD.PNG','グアテマラ 酸味とコクに優れ、香気も良好で全体的に華やかさとキレのいい後味が特徴。 ','2018-03-31'),('カフェ・ラッテ','FROM_COFFEE',299,'ERD.PNG','グアテマラ 酸味とコクに優れ、香気も良好で全体的に華やかさとキレのいい後味が特徴。 ','2018-03-05'),('海軍風コーヒー','PURE_COFFEE',442,'ERD.PNG','グアテマラ 酸味とコクに優れ、香気も良好で全体的に華やかさとキレのいい後味が特徴。 ','2018-05-13'),('インド','PURE_COFFEE',245,'ERD.PNG','パプアニューギニア 浅い焙煎では軽くてクセの少ない風味、深い焙煎ではキレの良い強い苦味とコクのある風味。良質な香気も特徴。最高級品質と言われるブルーマウンテンの苗木をそのまま移植して栽培した品種である。 ','2017-08-29');
