INSERT INTO "product" (product_name,product_type,price,image_url,description,created_at) VALUES ('アイス・カフェ・オ・レ','PURE_COFFEE',294,'ERD.PNG','トラジャ（インドネシア） スラウェシ島産。苦みが中心の味で、非常に濃厚なコクを持つ。酸味は無い。カロシ・トラジャもしくは単にカロシという名称が使われることもある。 ','2018-12-08'),('コロンビア','NON_COFFEE',307,'ERD.PNG','マンデリン（インドネシア） スマトラ島産。苦味とコクを中心とした味わい、酸味はなく独特な後味がある。日本ではブルーマウンテンが現れるまでは世界一と評されていた。 ','2017-09-23'),('アイリッシュ・コーヒー','FROM_COFFEE',473,'ERD.PNG','ケニア フルーツのような爽やかな風味が特徴。全体的に強い風味でバランスが良い。ドイツなどヨーロッパではタンザニア産とともに一般的な銘柄。深めの焙煎が多い。 ','2018-04-14'),('アラビア・コーヒー','PURE_COFFEE',291,'ERD.PNG','サルバドル（エルサルバドル） 強く主張する味は無く、全体に甘く上品で柔らかな印象の味わい。 ','2017-10-25'),('コロンビア式コーヒー','NON_COFFEE',339,'ERD.PNG','コスタリカ どちらかというと酸味系で苦味控えめの味わい、軽めでクリアな飲み口。 ','2017-08-20'),('ケニア','FROM_COFFEE',365,'ERD.PNG','アラビカ種 病害虫や霜、少雨等に弱く栽培が困難だが、風味とコクに優れ、レギュラーコーヒー用を主体とし多様な品種がある。総生産量の約70%を占める[8]。 従来は、ブラジルのブルボンとコロンビアのティピカが、アラビカ種の2大品種と呼ばれ主力品種だった。その後、収量や耐病虫性に優れた品種への置換が進み、最近[いつ?]ではブラジルのカトゥーラ、カトゥアイとムンド・ノーボ、コロンビアのカトゥーラとバリエダ・コロンビアが、それぞれ主力品種となっている。 このほか、スマトラ、モカ（銘柄とは別）、ブルー・マウンテン（ブランドとは別）、コナ、マラゴジッペ、アマレロ、ゲイシャなどがある。 ','2018-10-18'),('アイス・カフェ・オ・レ','PURE_COFFEE',364,'ERD.PNG','ブラジル 香りの甘さが軽快で酸味・コク、苦みともに軽くバランスが良い。安価でありブレンドのベースとして多く使われる。 ','2018-11-23'),('アメリカン・コーヒー','FROM_COFFEE',387,'ERD.PNG','ケニア フルーツのような爽やかな風味が特徴。全体的に強い風味でバランスが良い。ドイツなどヨーロッパではタンザニア産とともに一般的な銘柄。深めの焙煎が多い。 ','2019-01-22'),('ジャワコーヒー（インドネシア）','NON_COFFEE',200,'ERD.PNG','コナ（ハワイ島） 非常に強い酸味とコク・風味を持つ。ブレンドに用いると良質な酸味が与えられるといわれる。ブルーマウンテンに次ぐブランドで高価である。 ','2017-10-01'),('ブラジル','FROM_COFFEE',340,'ERD.PNG','ベトナムなどアジア地域 ベトナムやネパール、中国など近年になって輸出向けにアラビカ種を導入した地域では、人気のある中南米地域の品種の苗木を導入しているが気候や土壌、生産技術の違いからか同じ品種でも独特の風味を持っている、総じてやや導入もとの中南米地域産に比べて重めの風味になり、酸味は控えめで香気もやや弱くなる傾向がある。','2018-12-30');
INSERT INTO "product" (product_name,product_type,price,image_url,description,created_at) VALUES ('アラビア・コーヒー','FROM_COFFEE',319,'ERD.PNG','キリマンジャロ（タンザニア） タンザニア産のコーヒーの日本での呼称。強い酸味とコクが特長。「野性味あふれる」と評されることが多い。深い焙煎では上品な苦味主体で浅 - 中煎りとは違った風味が楽しめる。 ','2017-08-20'),('ベトナム','PURE_COFFEE',513,'ERD.PNG','キューバ ブルーマウンテンに似た軽くてバランスの良い風味と上品な香気が特徴。ドミニカ共和国やハイチなどカリブ海地域の島国産のコーヒーは総じて似た傾向の風味を有する。 ','2019-04-17'),('コロンビア','FROM_COFFEE',539,'ERD.PNG','マンデリン（インドネシア） スマトラ島産。苦味とコクを中心とした味わい、酸味はなく独特な後味がある。日本ではブルーマウンテンが現れるまでは世界一と評されていた。 ','2018-04-20'),('アイスコーヒー','FROM_COFFEE',485,'ERD.PNG','キューバ ブルーマウンテンに似た軽くてバランスの良い風味と上品な香気が特徴。ドミニカ共和国やハイチなどカリブ海地域の島国産のコーヒーは総じて似た傾向の風味を有する。 ','2018-09-26'),('グリーン・コーヒー','FROM_COFFEE',308,'ERD.PNG','コロンビア 酸味と甘味が重厚だが突出せずバランスが良い。安価でありブレンドのベースに使われることも多い。コーヒーの基本の味。 ','2018-01-26'),('キューバ','NON_COFFEE',382,'ERD.PNG','ケニア フルーツのような爽やかな風味が特徴。全体的に強い風味でバランスが良い。ドイツなどヨーロッパではタンザニア産とともに一般的な銘柄。深めの焙煎が多い。 ','2017-08-20'),('カプチーノ','FROM_COFFEE',266,'ERD.PNG','パプアニューギニア 浅い焙煎では軽くてクセの少ない風味、深い焙煎ではキレの良い強い苦味とコクのある風味。良質な香気も特徴。最高級品質と言われるブルーマウンテンの苗木をそのまま移植して栽培した品種である。 ','2018-05-25'),('マンデリン（インドネシア）','FROM_COFFEE',440,'ERD.PNG','コロンビア 酸味と甘味が重厚だが突出せずバランスが良い。安価でありブレンドのベースに使われることも多い。コーヒーの基本の味。 ','2018-07-29'),('パプアニューギニア','PURE_COFFEE',418,'ERD.PNG','ケニア フルーツのような爽やかな風味が特徴。全体的に強い風味でバランスが良い。ドイツなどヨーロッパではタンザニア産とともに一般的な銘柄。深めの焙煎が多い。 ','2018-01-01'),('トラジャ（インドネシア）','NON_COFFEE',251,'ERD.PNG','ブラジル 香りの甘さが軽快で酸味・コク、苦みともに軽くバランスが良い。安価でありブレンドのベースとして多く使われる。 ','2018-03-03');
INSERT INTO "product" (product_name,product_type,price,image_url,description,created_at) VALUES ('コロンビア式コーヒー','FROM_COFFEE',353,'ERD.PNG','ブラジル 香りの甘さが軽快で酸味・コク、苦みともに軽くバランスが良い。安価でありブレンドのベースとして多く使われる。 ','2019-06-18'),('エスプレッソ','NON_COFFEE',507,'ERD.PNG','ブルーマウンテン（ジャマイカ） 卓越した香気を持ち、調和の取れた味わい、軽い口当りと滑らかな咽越しが特徴。最高級の品質と呼ばれる。ジャマイカで生産されるコーヒーのうちごく一部の産地のものがブルーマウンテンとブランド付けられる。その中でもさらにランク付けがなされる[14]。 ','2019-06-09'),('キリマンジャロ（タンザニア）','PURE_COFFEE',518,'ERD.PNG','インド インドのコーヒー栽培は400年以上の歴史があり、世界中のコーヒー産地の中でも有数の歴史と伝統を誇る。森の生態系を活かしながら有機的な農法で育てられ、5 - 6月に吹くモンスーンを利用した、約7週間を経てできる独特の香味は、欧米の多数の国で愛飲されている最高級品である。 ','2017-09-05'),('パプアニューギニア','FROM_COFFEE',523,'ERD.PNG','ロブスタ種 アラビカ種に比べて耐病性が高く、少雨、高温多湿の土地でも栽培できる。また安定収穫できる様になるまでにかかる期間が3年と短い。栽培が容易なので収量も多く、生産量2位のベトナムで主力となっている[8]。 抽出しやすく水出しも容易だが、カフェイン成分が多く苦みやクセ（ロブスタ臭）が強く、単独での風味はアラビカ種に及ばないとされる。インスタント用原料や、安いレギュラーコーヒーの増量用が主体となっている他、いわゆるベトナムコーヒーに用いられる。 ','2019-06-01'),('コロンビア','NON_COFFEE',364,'ERD.PNG','リベリカ種 高温多湿の気候に適応するが病害に弱く、品質もアラビカ種に及ばない。 ','2019-04-10'),('キューバ','NON_COFFEE',240,'ERD.PNG','マンデリン（インドネシア） スマトラ島産。苦味とコクを中心とした味わい、酸味はなく独特な後味がある。日本ではブルーマウンテンが現れるまでは世界一と評されていた。 ','2018-04-30'),('ベトナムコーヒー','PURE_COFFEE',267,'ERD.PNG','マンデリン（インドネシア） スマトラ島産。苦味とコクを中心とした味わい、酸味はなく独特な後味がある。日本ではブルーマウンテンが現れるまでは世界一と評されていた。 ','2019-07-29'),('グリーン・コーヒー','NON_COFFEE',436,'ERD.PNG','ジャワコーヒー（インドネシア） ジャワ島産の主にアラビカ種コーヒーを指す。かつての大産地でモカとブレンドしたモカジャバは最初のブレンドといわれるが、葉さび病と経済恐慌で産地が大打撃を受けて以降は産出量が少なく目にすることはまれである。現在[いつ?]手にはいるものは丸くマイルドな味。ジャワ島は専らアイスコーヒー・エスプレッソ・工業用に使用されるロブスタ種の主要な産地であるため、限定してアラビカ種を指す場合はジャワ・アラビカともいう。 ','2018-11-09'),('コスタリカ','PURE_COFFEE',517,'ERD.PNG','ケニア フルーツのような爽やかな風味が特徴。全体的に強い風味でバランスが良い。ドイツなどヨーロッパではタンザニア産とともに一般的な銘柄。深めの焙煎が多い。 ','2018-11-10'),('ジャワコーヒー（インドネシア）','PURE_COFFEE',256,'ERD.PNG','ロブスタ種 アラビカ種に比べて耐病性が高く、少雨、高温多湿の土地でも栽培できる。また安定収穫できる様になるまでにかかる期間が3年と短い。栽培が容易なので収量も多く、生産量2位のベトナムで主力となっている[8]。 抽出しやすく水出しも容易だが、カフェイン成分が多く苦みやクセ（ロブスタ臭）が強く、単独での風味はアラビカ種に及ばないとされる。インスタント用原料や、安いレギュラーコーヒーの増量用が主体となっている他、いわゆるベトナムコーヒーに用いられる。 ','2018-05-05');
